// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AdaUsdSimpleOracle {
    uint64 _exchangeRate;
    address immutable _owner;

    constructor(address owner) {
        _owner = owner;
    }

    function putPrice(uint64 price) public {
        require(msg.sender == _owner, "Only owner can put price");
        _exchangeRate = price;
    }

    function exchangeRate() public view returns (uint64) {
        return _exchangeRate;
    }
}
